import React, { Component } from "react";
import { NavLink } from "react-router-dom";

class Navigation extends Component {
  render() {
    return (
      <div>
        <div className="navigation">
          <NavLink exact="true" to="/" className="nav-home">
            Home
          </NavLink>
          <NavLink exact="true" to="/a-propos" className="nav-about">
            A propos de moi
          </NavLink>
          <NavLink exact="true" to="/atelier" className="nav-workshop">
            Mon atelier
          </NavLink>
          <NavLink exact="true" to="/contact" className="nav-active">
            Contact
          </NavLink>
        </div>
      </div>
    );
  }
}

export default Navigation;
